package aqqje.com.relation;public class Persion {    private String name;    private Adress adress;    private Car car;    public Persion() {    }    public Persion(String name, Adress adress, Car car) {        this.name = name;        this.adress = adress;        this.car = car;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public Adress getAdress() {        return adress;    }    public void setAdress(Adress adress) {        this.adress = adress;    }    public Car getCar() {        return car;    }    public void setCar(Car car) {        this.car = car;    }    @Override    public String toString() {        return "Persion{" +                "name='" + name + '\'' +                ", adress=" + adress +                ", car=" + car +                '}';    }}